import React from 'react';
import './'
const ImageZoom = () => {
  const carStyle = {
    width: '100px',
    height: '50px',
    backgroundColor: '#ff5722',
    position: 'absolute',
    top: '50%',
    transform: 'translateY(-50%) rotateY(20deg)',
    boxShadow: '5px 5px 15px rgba(0, 0, 0, 0.5)',
    borderRadius: '10px',
  };

  const wheelStyle = {
    width: '20px',
    height: '20px',
    backgroundColor: '#000',
    borderRadius: '50%',
    position: 'absolute',
    bottom: '-10px',
  };

  const frontWheelStyle = {
    ...wheelStyle,
    left: '10px',
  };

  const backWheelStyle = {
    ...wheelStyle,
    right: '10px',
  };

  const roadStyle = {
    position: 'relative',
    width: '100%',
    height: '100px',
    background: 'linear-gradient(to bottom, #606060 0%, #303030 100%)',
    overflow: 'hidden',
  };

  const animationStyle = {
    position: 'relative',
    width: '200%',
    height: '100px',
    animation: 'moveCar 5s linear infinite',
  };

  return (
    <div style={roadStyle}>
      <div style={animationStyle}>
        <div style={{ ...carStyle, left: 'calc(100% - 150px)' }}>
          <div style={frontWheelStyle}></div>
          <div style={backWheelStyle}></div>
        </div>
      </div>
    </div>
  );
};

export default ImageZoom;
